import React from 'react';
import { Col, Row, Button, Form, FormGroup, Label, Input, FormText, ListGroup, ListGroupItem } from 'reactstrap';

export default class Example extends React.Component {
  constructor(props) {
    super(props);

    this.state={
      fieldValue: ""
    }

   this.handleChange= this.handleChange.bind(this);
   this.handleClick= this.handleClick.bind(this);
}


  handleChange(event) {
    this.setState({fieldValue: event.target.value});
  }
   handleClick(){
      var nameobj= {"name": this.state.value};
      console.error(nameobj);
   }


  render() {
   // var{value}= this.state;
    return (
      <Form>
        <Row form>
          <Col md={6}>
            <FormGroup>
              <Label for="AddSong">Add a song</Label>
              <Input type="text" name="createSong" id="song" placeholder="Enter a song name..."
                 value={this.state.fieldValue}
                  onChange={this.handleChange}
              />
            </FormGroup>
          </Col>
        </Row>
        <Button onClick= {this.handleClick} id="createSong">Create</Button>
      </Form>
    );
  }
}
